import React from 'react';

function HistorySelector(props) {
  const historyList = [];
  for (let i = 0; i < localStorage.length; i++){
    if (localStorage.key(i).includes('wapp-')) {
      historyList.push((localStorage.key(i)).substring('wapp_'.length))
    }
  }

  const options = historyList.map((data, index) =>
    <option 
        key={index}
        value={data}
    >
        {data}
    </option>
  );

  return(
      <div>
        <select id="city" onChange={props.handleSelect}>
          {options}
        </select>
      </div>
  );
};

export default HistorySelector;
